import logo from './logo.svg';
import Register from './unprotected/register'
import Login from './unprotected/login'
import Navigation from './elements/navigation'
import Footer from './elements/footer'
import './App.css';
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link,
  useParams
} from "react-router-dom";
function App() {

  return <div>
    <Router>
    <Navigation/>
        <Switch>
          <Route path="/"  component={Login}/>
          {/* Information */}
          <Route path="/terms"  component={Login}/>
          <Route path="/privacy"  component={Login}/>

          {/* Access / Unprotected */}
          <Route path="/register"  component={Register}/>
          <Route path="/login"  component={Login}/>

          {/* Protected */}
          <Route path="/dashboard"  component={Login}/>
          <Route path="/cv"  component={Register}/>
          <Route path="/skills"  component={Login}/>
          <Route path="/profile"  component={Login}/>
          <Route path="/entity"  component={Login}/>

          {/* Not Found */}
          <Route path="*" component={() => "404 NOT FOUND"}/>

        </Switch>
      <Footer/>
    </Router>  


  </div>
}

export default App;
